import React, { useState, useEffect } from 'react';
import styled, { css } from 'styled-components';
import { Link } from "react-router-dom";
import { ROUTES } from '../constants';
import Logo from '../../WhiteLogo.PNG';

const NavLink = styled(Link)`
  font-size: 20px;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px 15px;
  color: white;
  text-decoration: none;
  transition: color 0.2s ease-out, background-color 0.2s ease-out;
  border-radius: 3px;
  border: 0px solid white;
  position: relative;
  z-index: 10;

  &:hover {
    background-color: white;
    color: #4c4c4c;
    cursor: pointer;
    transition: background-color 0.3s ease-out;
  }

  ${({ selected }) => selected && css`
    background-color: #f0f0f0;
    color: #4c4c4c;
  `}
`;

const Logoimg = styled.img`
  display: flex;
  justify-content: center;
  width: 4%;
  max-width: 100px; /* Ensures the logo doesn't get too large */
  height: auto; /* Maintains aspect ratio */
  position: absolute;
  left: 20px;
  top: 10px;
  z-index: 10;

  @media (max-width: 768px) {
    width: 7%;
  }

  @media (max-width: 480px) {
    width: 10%;
  }
`;

const NavbarContainer = styled.div`
  background-color: transparent;
  padding: 10px 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  z-index: 10;
  flex-wrap: wrap; /* Allow items to wrap */
  margin-left: 80px; /* Add margin to move tabs to the right */

  @media (max-width: 768px) {
    justify-content: space-around;
  }
`;

const Dropdown = styled.div`
  display: none;
  flex-direction: column;
  background-color: #333;
  position: absolute;
  top: 60px;
  right: 20px;
  width: 100%;
  box-shadow: 0 8px 16px rgba(0,0,0,0.3);

  @media (max-width: 768px) {
    display: flex;
  }
`;

const DropdownLink = styled(Link)`
  padding: 10px;
  text-decoration: none;
  color: white;
  display: block;

  &:hover {
    background-color: #575757;
  }
`;

const PageContainer = styled.div`
  background-color: #f0f0f0; 
`;

export const Navbar = () => {
  const [selectedTab, setSelectedTab] = useState(ROUTES.HOME_PATH);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  useEffect(() => {
    const currentPath = window.location.pathname;
    setSelectedTab(currentPath);
  }, []);

  const handleTabClick = (path) => {
    setSelectedTab(path);
  };

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <PageContainer>
      <div>
        <Link to={ROUTES.HOME_PATH} onClick={() => handleTabClick(ROUTES.HOME_PATH)}>
          <Logoimg src={Logo} />
        </Link>
        <NavbarContainer>
          <NavLink to={ROUTES.HOME_PATH} onClick={() => handleTabClick(ROUTES.HOME_PATH)} selected={selectedTab === ROUTES.HOME_PATH}>
            HOME
          </NavLink>
          <NavLink to={ROUTES.SOTD_PATH} onClick={() => handleTabClick(ROUTES.SOTD_PATH)} selected={selectedTab === ROUTES.SOTD_PATH}>
            SOTD
          </NavLink>
          <NavLink to={ROUTES.ABOUT_PATH} onClick={() => handleTabClick(ROUTES.ABOUT_PATH)} selected={selectedTab === ROUTES.ABOUT_PATH}>
            ABOUT
          </NavLink>
          <NavLink to={ROUTES.CONTACT_PATH} onClick={() => handleTabClick(ROUTES.CONTACT_PATH)} selected={selectedTab === ROUTES.CONTACT_PATH}>
            CONTACT
          </NavLink>
          <div onClick={toggleDropdown} style={{ cursor: 'pointer', color: 'white', display: 'flex', alignItems: 'center' }}>
            Menu
          </div>
          {isDropdownOpen && (
            <Dropdown>
              <DropdownLink to={ROUTES.HOME_PATH} onClick={() => handleTabClick(ROUTES.HOME_PATH)}>
                HOME
              </DropdownLink>
              <DropdownLink to={ROUTES.SOTD_PATH} onClick={() => handleTabClick(ROUTES.SOTD_PATH)}>
                SOTD
              </DropdownLink>
              <DropdownLink to={ROUTES.ABOUT_PATH} onClick={() => handleTabClick(ROUTES.ABOUT_PATH)}>
                ABOUT
              </DropdownLink>
              <DropdownLink to={ROUTES.CONTACT_PATH} onClick={() => handleTabClick(ROUTES.CONTACT_PATH)}>
                CONTACT
              </DropdownLink>
            </Dropdown>
          )}
        </NavbarContainer>
      </div>
    </PageContainer>
  );
};
